import React from 'react';
import './styles/App.css';

const App = () => {
	return (
		<div>
			<Header />
			<Technologies />
		</div>
	);
};

const Header = () => {
	return (
		<div>
			<a href="#s">aaaaaaaaa</a>
			<a href="#s">bbbbbbbbbbb</a>
			<a href="#s">ccc</a>
			<a href="#s">dddd</a>
		</div>
	);
};

const Technologies = () => {
	return (
		<div>
			<ul>
				<li>css</li>
				<li>html</li>
				<li>css</li>
				<li>html</li>
			</ul>
		</div>
	);
};

export default App;
